import React from 'react';
import {BrowserRouter as Router ,Routes, Route } from 'react-router-dom';

import { Landing } from './components'

const App = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/" component={Landing} />
        </Switch>
      </Router>
    </>
  )
}

export default App
